import React from "react";

function NotFound() {
  return (
    <div className="notFoundContainer">
      <div>
        <h1>404</h1>
        <p>Page Not Found</p>
        <a href="/">Go back to Home</a>
      </div>
    </div>
  );
}

export default NotFound;
